<!DOCTYPE html>
<html lang="zh-Hant">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>陳移宇 - 個人履歷</title>
  <style>
    * {
      box-sizing: border-box;
      margin: 0;
      padding: 0;
      font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif;
    }
    body {
      background-color: #f5f6fa;
      color: #2f3640;
      display: flex;
      justify-content: center;
      padding: 30px 20px;
    }
    .resume-container {
      background-color: #fff;
      max-width: 800px;
      width: 100%;
      padding: 40px;
      border-radius: 20px;
      box-shadow: 0 10px 30px rgba(0,0,0,0.1);
    }
    .profile {
      text-align: center;
      margin-bottom: 40px;
    }
    .profile img {
      width: 150px;
      height: 150px;
      border-radius: 50%;
      object-fit: cover;
      margin-bottom: 20px;
      border: 3px solid #4cd137;
    }
    .profile h1 {
      font-size: 2em;
      margin-bottom: 10px;
    }
    .profile p {
      font-size: 1em;
      color: #718093;
    }
    h2 {
      color: #4cd137;
      margin-bottom: 15px;
      border-bottom: 2px solid #4cd137;
      padding-bottom: 5px;
    }
    section {
      margin-bottom: 30px;
    }
    ul {
      list-style: none;
      padding-left: 0;
    }
    li {
      margin-bottom: 10px;
      line-height: 1.5;
    }
    .contact a {
      color: #4cd137;
      text-decoration: none;
    }
    .contact a:hover {
      text-decoration: underline;
    }
  </style>
</head>
